"use strict";

const myImage = new Image();
myImage.src = "data:image/jpeg;base64,"

myImage.addEventListener("load", main);

function main() {
    /** @type {HTMLCanvasElement}  */
    const canvas = document.getElementById("canvas");
    /** @type {CanvasRenderingContext2D} */
    const ctx = canvas.getContext("2d", { alpha: false });

    canvas.width = 500;
    canvas.height = 663;

    // Draw img
    ctx.drawImage(myImage, 0, 0, canvas.width, canvas.height);
    // Analyze img
    const pixels = ctx.getImageData(0, 0, canvas.width, canvas.height);
    // Clear img
    ctx.clearRect(0, 0, canvas.width, canvas.height);

    const totalParticles = 5000;
    let particlesArr = [];
    let mappedImage = [];

    for (let y = 0; y < canvas.height; y++) {
        let row = [];

        for (let x = 0; x < canvas.width; x++) {
            const red = pixels.data[(y * 4 * pixels.width) + (x * 4)];
            const green = pixels.data[(y * 4 * pixels.width) + (x * 4 + 1)];
            const blue = pixels.data[(y * 4 * pixels.width) + (x * 4 + 2)];
            const brightness = calcRelativeBrightness(red, green, blue);

            row.push(brightness);
        }

        mappedImage.push(new Float32Array(row));
    }

    /**
     * @param {number} red 
     * @param {number} green 
     * @param {number} blue 
     * @returns {number}
     */
    function calcRelativeBrightness(red, green, blue) {
        return Math.sqrt(
            (red * red) * 0.299 +
            (green * green) * 0.587 +
            (blue * blue) * 0.114
        ) / 100;
    }

    /**
     * @param {number} canvasWidth 
     * @returns {number}
     */
    function getRandomIntBasedOnCanvasWidth(canvasWidth) {
        return Math.floor(Math.random() * canvasWidth);
    }

    class Particle {
        constructor() {
            this.x = getRandomIntBasedOnCanvasWidth(canvas.width);
            this.y = 0;
            this.speed = 0;
            this.velocity = Math.random() * 0.5;
            this.size = Math.random() * 1.5 + 1;
            this.position1 = Math.floor(this.y); // int
            this.position2 = Math.floor(this.x); // int
        }

        update() {
            this.position1 = Math.floor(this.y);
            this.position2 = Math.floor(this.x);
            this.speed = mappedImage[this.position1][this.position2];

            const movement = (2.5 - this.speed) + this.velocity;
            this.y += movement;

            if (this.y >= canvas.height) {
                this.y = 0;
                this.x = getRandomIntBasedOnCanvasWidth(canvas.width);
            }
        }

        draw() {
            ctx.beginPath();
            ctx.arc(this.x, this.y, this.size, 0, 2 * Math.PI);
            ctx.fill();
        }
    }

    function init() {
        for (let i = 0; i < totalParticles; i++) {
            particlesArr.push(new Particle);
        }
    }

    function animate() {
        ctx.globalAlpha = 0.05;
        ctx.fillStyle = "rgb(0, 0, 0)";
        ctx.fillRect(0, 0, canvas.width, canvas.height);

        /*  Set fillStyle for particles before drawing
            to avoid setting for each draw call
        */
        ctx.fillStyle = "#bbf7d0";

        for (let i = 0; i < particlesArr.length; i++) {
            particlesArr[i].update();
            ctx.globalAlpha = particlesArr[i].speed * 0.5;
            particlesArr[i].draw();
        }

        requestAnimationFrame(animate);
    }

    init();
    animate();
}
